import './App.css';
import Map from "mapmyindia-react";
import React from 'react';
const lat= 18.5314;
function App() {
		 return (
		 	 <Map
          markers={[
              { 
                  position: [ lat , 73.845],
                  draggable: true, 
                  title:"Marker title",
                  onClick: e => {
                      console.log("clicked ");
                  },
                  onDragend: e => {
                      console.log("dragged");
                  }
              }
          ]}
          />

		 )
	 }

export default App;
